    "Mongolia - Energy and Environment Project, Stove Subsidies Component",nt"tracking_summary":
    {ntt"total": 34,ntt"recent": 11nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-12-08T21:04:38.716362",nt"name": "mongolia-energy-and-environment-project-stove-subsidies-component",nt"isopen":
    false,nt"url": null,nt"notes": " n        This impact evaluation assessed
    stove performance and impacts under real-world usage conditions. It was designed
    to answer the following questions:nnEvaluation question 1: How do energy-efficient
    products impact ambient air pollution levels, and health and income of residents
    in Ulaanbaatar? Specifically:na) How does the use of MCA stoves affect fuel usage
    and expenditures?nb) Does the use of MCA stoves affect available household income?nc)
    What is the impact of MCA stoves on emissions of CO and PM2.5? nd) What is the impact
    of MCA stoves on indoor concentrations of CO and PM2.5? ne) What would be the estimated
    change in health for Ulaanbaatar residents?nf) How do MCA stoves affect household
    expenditures related to respiratory health problems?nnEvaluation question 2: How
    do different MCA stove models and different patterns of usage affect the level of
    impact on ambient air pollution, and the health and income of households with MCA
    stoves? Specifically:na) Do different MCA stove model types impact fuel expenditures,
    income, and PM2.5 emissions, under typical usage behavior?nb) Do deviations from
    expected MCA stove usage patterns impact air pollution, health, and income of households
    with MCA stoves?nc) Did the MCA stove program result in differential impacts on
    men and women?nd) Does possession of additional energy efficiency products such
    as vestibules or additional ger insulation modify the impact of MCA stoves on ambient
    air pollution, health, and income?nnSince this program was a market-based intervention,
    households chose whether to purchase an MCA stove. Because a randomized intervention
    assignment was not possible and the evaluation was implemented after the project
    had started, a quasi-experimental propensity score matching (PSM) design was used
    to adjust for differences between those who did and did not choose to purchase an
    MCA stove. Matching on propensity scores enabled construction of treatment and comparison
    groups that were balanced along the observed characteristics, thereby providing
    a counterfactual for the intervention.nnKey findings include:nn- Participants in
    the EEP stove subsidy program had 65% lower emissions of PM2.5 and 16% lower CO
    emissions, both statistically significant, compared to traditional stoves under
    typical usage conditions. nn- The EEP stove subsidy program reduced ambient PM2.5
    concentrations over UB attributable to heating stoves by an estimated 30%, with
    largest reductions in highly polluted areas that were more heavily targeted by the
    program. nn- Factors known to affect coal consumption differed systematically between
    Ulzii, Khas, and Dul stove users.nn- The EEP stove subsidy program achieved high
    demand for energy-efficient stoves and satisfaction among stove users; however,
    some stove limitations remained barriers to satisfaction.nn- The EEP stove subsidy
    program did not achieve significant reductions in daily coal consumption under typical
    usage conditions. nn- Very low compliance with MCA stove operation instructions
    may have contributed to lack of reduced coal consumption. nn- Significant reductions
    in coal use were observed when households used MCA stoves according to instructions.
    nn- Households using MCA stoves enjoyed significantly higher indoor temperatures,
    suggesting that users may be sacrificing fuel economy for comfort. nn- There is
    no evidence that the EEP stove subsidy program achieved reductions in overall coal
    expenditures. nn- MCA stove owners in gers with better insulation used less coal
    than traditional stove owners. nn- Observed emissions reductions may have contributed
    to substantially fewer cases of air pollution-related respiratory illness and related
